import React from "react";

const Herobox = (props) => {
    return (
        <div>
            <h1>Mi nombre es: {props.name} y yo soy {props.heroName}</h1>
            <img src={props.imagen} width="300" height="300"></img>
            <h2>Biografia</h2>
            {props.children}
            <a href={props.link}>{props.textlink}</a>  
        </div>
    )
}

export default Herobox;
